import React from 'react';
import { AuthContext } from "../../../context/AuthContext";
import { useContext } from "react";
import "./security.css";

const Security = () => {
  const { user } = useContext(AuthContext);

  return (
    <div className="privacyDetails">
      <div className="privacyContainer">
        <h2>Security</h2>
      </div>
      <div className="privacyinfo">
        <p>Adjust your security settings and set up two-factor authentication.</p>
      </div>
      <div className="line"></div>
      <div className="personalSettings">
        <ul>
          <li>
            <strong>Password</strong> <span className="privacyInfo">{user.email}</span>
            <></>
            <button className="manageButton">Manage</button>
          </li>
          <li>
            <strong>Privacy Settings:</strong> <span className="privacyInfo">{user.email}</span>
            <button className="manageButton">Manage</button>
          </li>

        </ul>
      </div>
    </div>
  );
};

export default Security;
